import React from 'react';
import Image from 'react-bootstrap/Image'
import me from './picture.JPG'
import './Picture.css'
import { FaGithub, FaLinkedin } from 'react-icons/fa';

class Pic extends React.Component {
  render() {
    return (
      <div className="picture">
        <Image src={me} alt="picture of me" fluid />
        <div className="intro m-0">
          {/* <h1 className="mt-0 mb-0 ml-2 mr-2">陈芳婷</h1> */}
          <h1 className="mt-0 mb-0 ml-2 mr-2">Fangting Chen</h1>
          <h3 className="mt-0 ml-2 mr-2"> 
            Hello! I'm currently in my final year of <br/>
            Computing Science at University of Alberta. <br/>
            Currently seeking full-time job opportunities <br/>
            starting in May 2020. I am passionate about software development, 
            I love the process of coming up with ideas and working on these ideas 
            to deliver user-friendly application. 
            </h3>
          <span > 
            <a href='https://www.linkedin.com/in/fangting-chen-73114b1a0/' style={{color: '#fff'}} target="_blank" rel="noopener noreferrer">
                <FaLinkedin className='mr-2 ml-2' size={50}/> 
            </a>
            <a href='https://github.com/Finicft' style={{color: '#fff'}} target="_blank" rel="noopener noreferrer">
                <FaGithub className='mr-2 ml-2' size={50}/>
            </a>
            <h3 className="mt-0 ml-2 mr-2"></h3>
          </span>

        </div>
      </div>
    );

    }
}

export default Pic;
